import React from "react";
import "./Chart.css";
import Chartbar from "./ChartBar";

const Chart = (props) => {
  <div className="chart">
    {props.dataPoint.map((dataPoint) => (
      <Chartbar
        key={dataPoint.label}
        value={dataPoint.value}
        maxValue={null}
        label={dataPoint.label}
      />
    ))}
  </div>;
};

export default Chart;
